import React from 'react';
import CalendarioDesplegable from '../components/CalendarioDesplegable';
const eventos = [
    {
      title: 'Evento 1',
      start: new Date(2023, 11, 20, ),
      end: new Date(2023, 11, 24, 12, 0),
    },
    {
      title: 'Evento 2',
      start: new Date(2023, 12, 20, 8, 0),
      end: new Date(2024, 0, 25, 12, 0),
    },
    // Agrega más eventos según sea necesario
  ];
const App = () => {
  return (
    <div>
      <h1>Aplicación con Calendario</h1>
      <CalendarioDesplegable fechaInicio="2023-12-20" fechaFin="2024-2-25" eventos={eventos} />
    </div>
  );
};

export default App;
